import "./loginCredits.css"
const LoginCredits = () => {
    return(
        <>
            <div className='creditContainer'>
                <a className='credits' href="https://www.freepik.com/photos/color-overlay">background credits</a>
                <a className="credits" href='https://vecteezy.com/'>card background credits</a>
            </div>
        </>
    )
}
export default LoginCredits
